import {Route,Routes} from 'react-router-dom'
import './App.css';
import Navbar from './components/Navbar';
import Products from './views/Products';

function App() {
  return (
    <div className="App">
      <Navbar />
     <div className='container'>
       <Routes>
         <Route path ='/' element={<Products />} />
       </Routes>
     </div>
    </div>
  );
}

export default App;
